  false,\n\t\"url\": null,\n\t\"notes\": \"This Environmental Assessment is needed
  to manage for chronic wasting disease on Crescent Lake NWR.  There were two alternatives
  seriously considered: no action and taking 50 or more deer in order to prevent or
  slow the progress of chronic wasting disease. A third alternative of manipulating
  habitat to disperse the deer herd was considered and rejected because of the adverse
  impact such actions would have on migratory bird habitat.  This EA will be included
  in the Chronic Wasting Disease Contingency Plan for Crescent Lake NWR.\",\n\t\"owner_org\":
